function polygonOf(path, lengthDelta){
	var pathLength = path.getTotalLength();
	if (pathLength == 0 || pathLength == 1/0){
		return [];
	}

	var numPositions = Math.ceil(pathLength/lengthDelta);
  var includeLastPositionManually = (pathLength % lengthDelta > 0.005);
  positions = [];

  for(var i = 0; i < numPositions; i++){
  	var point = path.getPointAtLength(lengthDelta * i);
  	positions.push(point.x + "," + point.y);
  }
  if(includeLastPositionManually == true){
  	var point = path.getPointAtLength(pathLength);
  	positions.push(point.x + "," + point.y);
  }

  return positions;
}

function process_paths(){
	var length = path_strs.length;
	for (var i = 0; i < length; i++) {
		if(path_strs[i] != null){
			path = document.createElementNS("http://www.w3.org/2000/svg", 'path');
	  	path.setAttribute('d', path_strs[i]);

	  	totalLength = path.getTotalLength();
	  	segList = path.pathSegList;
	  	lengths = [];
	  	
	  	start_x = segList.getItem(0).x;
	  	cur_x = start_x;
	  	start_y = segList.getItem(0).y;
	  	cur_y = start_y;
	  	var seg, lastSeg;
	  	var commandUpperCase;

	  	for (var j = 1; j < segList.numberOfItems; j++) {
	  		seg = segList.getItem(j);

	  		commandUpperCase = seg.pathSegTypeAsLetter.toUpperCase();
	  		absolute = (seg.pathSegTypeAsLetter == seg.pathSegTypeAsLetter.toUpperCase());

	  		subPath = document.createElementNS("http://www.w3.org/2000/svg", 'path');
  			subPath.pathSegList.appendItem(subPath.createSVGPathSegMovetoAbs(cur_x, cur_y));

  			if(commandUpperCase == "M"){
  				if(absolute){
		  			cur_x = seg.x;
		  			cur_y = seg.y;
		  		}
		  		else{
		  			cur_x += seg.x;
			  		cur_y += seg.y;
		  		}

	  			start_x = cur_x;
	  			start_y = cur_y;
	  		}
	  		else if(commandUpperCase == "Z"){
	  			subPath.pathSegList.appendItem(subPath.createSVGPathSegLinetoAbs(start_x, start_y));
	  		}
	  		else if(commandUpperCase == "S"){
	  			var control1_x, control1_y;
	  			var control2_x = seg.x2, control2_y = seg.y2, endp_x = seg.x, endp_y = seg.y;

	  			if ("CcSs".indexOf(lastSeg.pathSegTypeAsLetter) > -1){
            // O primeiro ponto de controle é assumido como sendo o 
            // reflexo do segundo ponto de controle no comando anterior em relação ao ponto atual.
            control1_x = cur_x + cur_x - lastSeg.x2;
            control1_y = cur_y + cur_y - lastSeg.y2;
            //console.log("(x2, y2) ant: " + lastSeg.x2 + "," + lastSeg.y2)
          }
          else{
            // Se não houver nenhum comando anterior ou se o anterior comando não foi C, C, S ou S, 
            // assumir o primeiro ponto de controle é coincidente com o ponto atual.
            control1_x = cur_x;
            control1_y = cur_y;
          }

          if (!absolute){
          	control2_x += cur_x;
          	control2_y += cur_y;
          	endp_x += cur_x;
          	endp_y += cur_y;
          }

          subPath.pathSegList.appendItem(subPath.createSVGPathSegCurvetoCubicAbs(endp_x, endp_y, control1_x, control1_y, control2_x, control2_y));
          
          cur_x = endp_x;
          cur_y = endp_y;
	  		}
	  		else if(commandUpperCase == "T"){
	  			var control_x, control_y;
	  			var endp_x = seg.x, endp_y = seg.y;

	  			if ("QT".indexOf(lastSeg.pathSegTypeAsLetter) > -1){
	  				control_x = cur_x + cur_x - lastSeg.x1;
	  				control_y = cur_y + cur_y - lastSeg.y1;
	  			}
	  			else{
	              control_x = cur_x;
	              control_y = cur_y;
			  			}
	                  
	            if (!absolute){
	              control_x += cur_x;
	            	control_y += cur_y;
	            	endp_x += cur_x;
	            	endp_y += cur_y;
	            }
	                  
	            subPath.pathSegList.appendItem(subPath.createSVGPathSegCurvetoQuadraticAbs(endp_x, endp_y, control_x, control_y));
			  	
			  	cur_x = endp_x;
	            cur_y = endp_y;
	  		}
	  		else if (commandUpperCase == "L"){
	  			var endp_x = seg.x, endp_y = seg.y;

	  			if(!absolute){
	  				endp_x += cur_x;
	  				endp_y += cur_y;
	  			}

	  			subPath.pathSegList.appendItem(subPath.createSVGPathSegLinetoAbs(endp_x, endp_y));
	  			cur_x = endp_x;
          cur_y = endp_y;
	  		}
	  		else if (commandUpperCase == "H"){
	  			var endp_x = seg.x, endp_y = cur_y;

	  			if(!absolute){
	  				endp_x += cur_x;
	  			}

	  			subPath.pathSegList.appendItem(subPath.createSVGPathSegLinetoAbs(endp_x, endp_y));
	  			cur_x = endp_x;
          		cur_y = endp_y;
	  		}
	  		
	  		else if (commandUpperCase == "V"){
	  			var endp_x = cur_x, endp_y = seg.y;

	  			if(!absolute){
	  				endp_y += cur_y;
	  			}

	  			subPath.pathSegList.appendItem(subPath.createSVGPathSegLinetoAbs(endp_x, endp_y));
	  			cur_x = endp_x;
          		cur_y = endp_y;
	  		}
	  		else if (commandUpperCase == "C"){
	  			var control1_x = seg.x1, control1_y = seg.y1;
	  			var control2_x = seg.x2, control2_y = seg.y2, endp_x = seg.x, endp_y = seg.y;

          if (!absolute){
          	control1_x += cur_x;
          	control1_y += cur_y;
          	control2_x += cur_x;
          	control2_y += cur_y;
          	endp_x += cur_x;
          	endp_y += cur_y;
          }

          subPath.pathSegList.appendItem(subPath.createSVGPathSegCurvetoCubicAbs(endp_x, endp_y, control1_x, control1_y, control2_x, control2_y));
          
          cur_x = endp_x;
          cur_y = endp_y;
        }
        else if(commandUpperCase == "Q"){
	  			var control_x = seg.x1, control_y = seg.y1;
	  			var endp_x = seg.x, endp_y = seg.y;
	                  
          if (!absolute){
          	control_x += cur_x;
          	control_y += cur_y;
          	endp_x += cur_x;
          	endp_y += cur_y;
          }
                
          subPath.pathSegList.appendItem(subPath.createSVGPathSegCurvetoQuadraticAbs(endp_x, endp_y, control_x, control_y));
	  	
			  	cur_x = endp_x;
          cur_y = endp_y;
	  		}
	  		else if (commandUpperCase == "A"){
	  			var endp_x = seg.x, endp_y = seg.y;

	  			if (!absolute){
          	endp_x += cur_x;
          	endp_y += cur_y;
          }

          subPath.pathSegList.appendItem(subPath.createSVGPathSegArcAbs(endp_x, endp_y, seg.r1, seg.r2, seg.angle, seg.largeArcFlag, seg.sweepFlag));
	  	
          cur_x = endp_x;
          cur_y = endp_y;
	  		}

	  		// Verificando se existe pelo menos 2 segmentos para calcular o Path (um segmento para mover para a posicao certa,
	  		// e outro para definir o caminho).
	  		// Repare que no caso de um MoveTo no meio de um Path faz com que o numero de segmentos seja de apenas 1
	  		// pois um MoveTo nao adiciona nenhum caminho ao path.
	  		if (subPath.pathSegList.numberOfItems > 1){
		  		subPathLength = subPath.getTotalLength();
		  		lengths.push(subPathLength);

		  		// Guardando o último segmento gerado para comandos relativos (ou seja, que utilizam algo dado anterior como parametro)
		  		lastSeg = subPath.pathSegList.getItem(1);
	  		}

	  	}

			console.log(":" + path_strs[i] + ":" + totalLength + "," + lengths + ":" + polygonOf(path, totalLength/10.0));
		}
		
	}
	phantom.exit();
}


