function access_pages(urls){
	var page = require('webpage').create();
	var url = urls.pop();

	page.open(url, function (status) {
		if (status !== 'success') {
	        console.log('Unable to access network');
	    } else {
	    	var regex = /\sd=\"([^\"]*)\"/gi;
	    	var content = page.content;
			var result;
			while ((result = regex.exec(content))) {
			    path_strs.push(result[1]);
			}
	    	
	    }
		if(urls.length == 0){
			process_paths();
		}
		else{
			access_pages(urls);
		}
	});
}

access_pages(urls);